        #view {
            margin-top: -100vh;
            height: 100vh;
            width: 100%;
            overflow: hidden;
            transition: opacity 1s;
            opacity: 1;

        @media(min-aspect-ratio: 1/1) {

        @media(max-aspect-ratio: 1/1) {

        #view .info {

        }

        #view .header {

        @media(min-aspect-ratio: 1/1) {
            #view .header {
                font-size: 5vh;

        }

        @media(max-aspect-ratio: 1/1) {

        @media(min-aspect-ratio: 1/1) {
            #view .p {
                font-size: 5vh
            }
        }

        @media(max-aspect-ratio: 1/1) {
            #view .p {
                font-size: 5vw
            }
        }

        #view #content {

            box-shadow: 0px 4px 4px 0px rgba(0, 0, 0, .25);

            background: #fff;

        }

        @media(min-aspect-ratio: 1/1) {
            #view .terms_vertical {

        }

        @media(min-aspect-ratio: 1/1) {

        }

        @media(max-aspect-ratio: 1/1) {
            #modal .modal_inner button {
                width: 80%;
                height: 10vw;
                font-size: 5vw
            }
        }

        @keyframes fone1dark_anim {

            }
        }

        @keyframes fone2dark_anim {
            0% {
                transform: translate(0, 0)
            }

            100% {
                transform: translate(-100px, 200px)
            }
        }

        .z1 {

        }

        .bf0 {

        }

        #modal_blur {

        }

        #modal_blur .inner {

            backdrop-filter: blur(2px);
            position: relative;
            z-index: 3;
            transition: 1s;
            opacity: 1
        }

        .z-1 {
            z-index: -1 !important
        }

        window.addEventListener("load", function () {
            (dapi.isReady()) ? onReadyCallback() : dapi.addEventListener("ready", onReadyCallback);

        });
        dapi.addEventListener("audioVolumeChange", onReadyCallback);
        function onVolumeChangeCallback() {
            console.log('Audio change')
        }
        function onReadyCallback() {
            //no need to listen to this event anymore
            dapi.removeEventListener("ready", onReadyCallback);
            let isAudioEnabled = !!dapi.getAudioVolume();
            if (dapi.isViewable()) {
                adVisibleCallback({ isViewable: true });
            }

            dapi.addEventListener("viewableChange", adVisibleCallback); //this event is used to know when the ad was visible/hidden
            dapi.addEventListener("adResized", adResizeCallback); //this event is used recalculate ad UI items(mostly upon rotation)
            dapi.addEventListener("audioVolumeChange", audioVolumeChangeCallback); //this event is used to get info about any volume state change
        }
        function startGame() {
            //start your game here
            var screenSize = dapi.getScreenSize();
            //(add your own code here)
        }
        function pauseGame() {
            //pause your game here(add your own code here)
        }
        function adVisibleCallback(event) {
            console.log("isViewable " + event.isViewable);
            if (event.isViewable) {
                screenSize = dapi.getScreenSize();
                //START or RESUME the ad (add your own code here)
                event.startGame(); //example of function that can be called to start game
            } else {
                //PAUSE the ad and MUTE sounds or DO nothing if creative hasnât been launched yet (add your own code here)
                event.pauseGame(); //example of function that can be called to pause game
            }
        }
        function adResizeCallback(event) {
            screenSize = event;
            console.log("ad was resized width " + event.width + " height " + event.height);
        }
        //When user clicks on the download button - use openStoreUrl function
        function userClickedDownloadButton(event) {
            dapi.openStoreUrl();
        }
        function audioVolumeChangeCallback(volume) {
            let isAudioEnabled = !!volume;
            if (isAudioEnabled) {
                //START or turn on the sound(add your own code here)
            } else {
                //PAUSE the turn off the sound(add your own code here)
            }
        }
        const openModal = () => {
            document.getElementById("content").classList.add('onone')
            setTimeout(() => {
                document.getElementById("content").classList.add('z-1')
            }, 1000)
            // document.getElementById("view").classList.add('onone')
            setTimeout(() => {
                document.getElementById('modal').classList.remove('dnone');
                setTimeout(() => { document.getElementById('modal').classList.remove('onone'); }, 100)
            }, 500)

            document.getElementById("modal_blur_inner").classList.remove('bf0');
            document.getElementById("header").classList.add('z1');
            document.getElementById("logo").classList.add('z1');
            document.getElementById("p").classList.add('z1');

            setTimeout(() => {
                document.getElementById('modal').classList.remove('dnone');
                setTimeout(() => { document.getElementById('modal').classList.remove('onone'); }, 100)
            }, 500)

            document.getElementById("modal_fone").classList.remove('onone')


            var stars = document.getElementsByClassName('star')
            for (let i = 0; i < stars.length; i++) {
                stars[i].classList.add('z3');
            }
            var dots = document.getElementsByClassName('dot')
            for (let i = 0; i < dots.length; i++) {
                dots[i].classList.add('z3');
            }
        }
        var buttons = document.getElementsByClassName('target_button');
        for (let i = 0; i < buttons.length; i++) {
            buttons[i].onclick = () => openModal();
        }
